<script>

        $('.code-btn').click(function(e) {
            var ths = $(this);
            var emailId = $('#emailId').val();
       
          
            // alert(sponsor); 
            $.ajax({
                type: "POST"
                , url: "{{ route('send_forgot') }}"
                , data: {
                    "emailId":emailId,
                     "_token": "{{ csrf_token() }}"
                , }
                , success: function(response) {
                    // alert(response);      
                    if (response) {
                        // alert("hh");
                        iziToast.success({
                        message: 'Email send Successfully',
                        position: "topRight"
                    });
                    } else {
                        // alert("hi");
                        iziToast.error({
                        message: 'Error!',
                        position: "topRight"
                    });
                    }
                }
            });
        });
            </script>









